def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.2:
            priorities[i] = np.log(1 + ratio) + 0.1
        elif ratio >= 0.2 and ratio < 0.6:
            priorities[i] = np.log(1 + ratio) + 0.3
        elif ratio >= 0.6 and ratio < 0.8:
            priorities[i] = np.log(1 + ratio) + 0.5
        else:
            priorities[i] = np.log(1 + ratio) + 0.7

        for j in range(1, 11):
            if i % j == 0:
                priorities[i] += 0.1 * j
            elif i % (j + 2) == 0:
                priorities[i] -= 0.05 * j
            elif i % (j + 3) == 0:
                priorities[i] += 0.07 * j
            else:
                priorities[i] += 0.03 * j

    return priorities
